import './Game.css'

const Game = () => {
  const url = 'https://pokeres.bastionbot.org/images/pokemon';
  const pokemons = [
    { id:1, name: 'balbasaur'},
    { id:8, name: 'wartotle'},
    { id:9, name: 'blastoise'},
    { id:6, name: 'charizard'},
  ];
  return (
    <div className="game">

    </div>
  )
}

export default Game
